import logo from '../Images/images.jpeg';

const List=()=>{
    return(
        <>
    <header>
        <div className="container container-flex">
            <div className="logoContainer">
                <img src={logo} alt="logo" className />
            </div>
        </div>
    </header>
        </>
    )
}
export default List;
